import React from 'react';
import { Button } from 'react-bootstrap';

interface IServiceCardProps {
  id: number;
  title: string;
  subtitle: string;
  description: string;
  backgroundImage: string;
}

const ServiceCard: React.FC<IServiceCardProps> = ({ id, title, subtitle, description, backgroundImage }) => {
  return (
    <div
      style={{
        backgroundImage: `url(${backgroundImage})`,
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        height: '300px',
        position: 'relative',
        overflow: 'hidden',
        borderRadius: '8px',
        cursor: 'pointer',
      }}
    >
      <div
        style={{
          position: 'absolute',
          top: 0,
          left: 0,
          width: '100%',
          height: '100%',
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'space-between',
          padding: '20px',
          backgroundColor: 'rgba(0, 0, 0, 0.6)',
          color: '#fff',
        }}
      >
        <div>
          <h3>{title}</h3>
          <p>{subtitle}</p>
        </div>
        <p>{description}</p>
        <div style={{ display: 'flex', gap: '10px' }}>
          <Button
            variant="primary"
            style={{ backgroundColor: '#FF6B6B', borderColor: '#FF6B6B', color: '#fff' }}
          >
            Мне это интересно
          </Button>
          <Button
            variant="primary"
            style={{ backgroundColor: '#007bff', borderColor: '#007bff', color: '#fff' }}
          >
            Подробнее
          </Button>
        </div>
      </div>
    </div>
  );
};

export default ServiceCard;
